@import "tailwindcss/utilities";

/* Simple defaults */

body {
  @apply font-sans antialiased;
  foo: bar;
}

.gradient-background {
  background: linear-gradient(to right, #c29ffd, #9a98ff);
  background-size: 300% 300%;
